import React from "react";

export default class ListWidgetComponent extends React.Component {
    constructor(props) {
        super(props);

        this.state = {
            elements: false,
        }
    }

    componentDidMount() {
        const { requestUrl } = this.props;
        const url = 'http://localhost:5000' + requestUrl;
        console.log(url);
        this.setState({
            elements: true
        });
        fetch(url)
            .then(res => res.json())
            .then(result => this.setState({
                elements: result
            }));
    }

    _renderListItems() {
        const { elements } = this.state;
        let list = [];
        elements.map(element => list.push(
            <li key={element._id}>element</li>
        ));
    }

    render() {
        return(
            <span>
                {this.props.msg}
            </span>
        );
    }
};
